import React from 'react';
import {StyledTypography} from '../../style/styled'

export default function TaskItem(props) {
    return (
        <div key={props.id}>
            <StyledTypography align={'justify'} variant={'body1'}>{
                props.text
            }</StyledTypography>
        </div>
    );
}
